export const getCategories = async () => {
    try {
        const response = await fetch(url, {
            method: 'GET',
            headers: {
                Accept: 'application/json',
                'Content-Type': 'application/json',
            }
        });
        const json = await response.json();
        setData(json.categories);
    } catch (error) {
        console.error(error);
    } finally {
        setLoading(false);
    }
}
